var jump = function (nums) {
  let len = nums.length;
  let farthest = 0;
  let end = 0;
  let jump = 0;
  for (let i = 0; i < len - 1; i++) {
    farthest = Math.max(i + nums[i], farthest);
    if (end === i) {
      jump++;
      end = farthest;
    }
  }
  return jump;
};
