/**
 * @param {number[]} nums
 * @return {number}
 */
var jump = function (nums) {
  let len = nums.length;
  let memo = Array.from({ length: len }).fill(len);
  //\u8868\u793A\u4ECEp\u5904\u8DF3\u5230\u6700\u540E\u4F4D\u7F6E\u7684\u6700\u5C11\u6B65\u6570
  const dp = (nums, p) => {
    // base case
    // \u5F53 p \u5230\u8FBE\u6700\u540E\u7684\u4F4D\u7F6E\uFF0C\u4E0D\u7528\u8DF3\uFF0C\u8FD4\u56DE0
    if (p >= len - 1) return 0;
    if (memo[p] !== len) return memo[p];
    let step = nums[p];
    for (let i = 1; i <= step; i++) {
      let subProblum = dp(nums, nums[i] + i);
      memo[p] = Math.min(memo[p], subProblum + 1);
    }
    return memo[p];
  };

  return dp(nums, 0);
};
`,paraId:0},{value:"376.\u6446\u52A8\u5E8F\u5217",paraId:0},{value:"medium",paraId:0},{value:"\u8D2A\u5FC3\u7B97\u6CD5",paraId:4,tocIndex:3},{value:"\u5B98\u65B9\u9898\u89E3",paraId:4,tocIndex:3},{value:`/**
 * @param {number[]} nums
 * @return {number}
 */
var wiggleMaxLength = function (nums) {
  const n = nums.length;
  if (n < 2) return n;

  let preDiff = nums[1] - nums[0];
  // base case
  // \u82E5\u524D\u4E24\u4F4D\u6570\u5DEE\u4E3A0\uFF0C\u90A3\u4E48\u6700\u957F\u7684\u6446\u52A8\u5B50\u5E8F\u5217\u5C31\u662F1\uFF0C\u5426\u5219\u5C31\u662F\u524D\u4E24\u4F4D\u6570\u5B57
  let res = preDiff !== 0 ? 2 : 1;

  for (let i = 2; i < n; i++) {
    const diff = nums[i] - nums[i - 1]; // \u5F53\u524Di\u4E0Ei-1\u7684\u5DEE
    //\u82E5diff\u4E0EpreDiff\u662F\u3010\u5CF0\u3011\u3010\u8C37\u3011\u7684\u6216\u662F\u3010\u8C37\u3011\u3010\u5CF0\u3011\u7684\uFF0Cres+1
    if ((diff > 0 && preDiff <= 0) || (diff < 0 && preDiff >= 0)) {
      res++;
      preDiff = diff;
    }
  }

  return res;
};
