var videoStitching = function (clips, time) {
  if (time === 0) return 0;
  let clipsArr = clips.sort((a, b) => {
    if (a[0] === b[0]) {
      // \u5982\u679C\u5F00\u5934\u76F8\u540C\uFF0C\u5C06\u6700\u957F\u7684\u7247\u6BB5\u653E\u5230\u6700\u524D\u9762
      return b[1] - a[1];
    }
    return a[0] - b[0];
  });

  let res = 0;
  let curEnd = 0,
    nextEnd = 0;
  let i = 0,
    len = clipsArr.length;

  while (i < len && clipsArr[i][0] <= curEnd) {
    while (i < len && clipsArr[i][0] <= curEnd) {
      nextEnd = Math.max(nextEnd, clipsArr[i][1]);
      i++;
    }

    res++;
    curEnd = nextEnd;
    if (curEnd >= time) {
      return res;
    }
  }

  // \u6CA1\u627E\u5230,\u8FD4\u56DE-1
  return -1;
};
