// \u6DF1\u5EA6\u4F18\u5148
var colorBorder = function (grid, row, col, color) {
  const m = grid.length,
    n = grid[0].length;
  const origColor = grid[row][col];
  const visited = new Array(m).fill().map((_) => new Array(n).fill(0));
  visited[row][col] = true;
  const borders = [];

  const direct = [
    [0, -1],
    [0, 1],
    [-1, 0],
    [1, 0],
  ];
  const dfs = (i, j) => {
    let isBorder = false;
    for (let z = 0; z < 4; z++) {
      const x = direct[z][0] + i,
        y = direct[z][1] + j;
      // \u627E\u51FA\u8FB9\u754C
      if (!(x >= 0 && y >= 0 && x < m && y < n && grid[x][y] === origColor)) {
        // \u91CD\u70B9
        isBorder = true;
      } else if (!visited[x][y]) {
        visited[x][y] = true;
        dfs(x, y);
      }
    }
    if (isBorder) {
      borders.push([i, j]);
    }
  };
  dfs(row, col);

  for (let i = 0; i < borders.length; i++) {
    const x = borders[i][0],
      y = borders[i][1];
    grid[x][y] = color;
  }

  return grid;
};
