var reversePairs = function (nums) {
  const len = nums.length;
  const temp = new Array(len);
  let count = 0;

  const merge = (lo, mid, hi) => {
    for (let i = lo; i <= hi; i++) {
      temp[i] = nums[i];
    }

    // ----\u5DE6\u53F3\u6570\u7EC4\u6709\u5E8F\u4E4B\u540E----
    let start = lo,
      end = mid + 1;

    while (start <= mid && end <= hi) {
      if (nums[start] > 2 * nums[end]) {
        count += mid + 1 - start;
        end++;
      } else {
        start++;
      }
    }

    // ----\u5408\u5E76\u4E4B\u524D----
    let i = lo,
      j = mid + 1;
    for (let p = lo; p <= hi; p++) {
      if (i === mid + 1) {
        nums[p] = temp[j++];
      } else if (j === hi + 1) {
        nums[p] = temp[i++];
      } else if (temp[i] > temp[j]) {
        nums[p] = temp[j++];
      } else {
        nums[p] = temp[i++];
      }
    }
  };

  const sort = (lo, hi) => {
    if (lo === hi) return;
    const mid = Math.floor(lo + (hi - lo) / 2);
    sort(lo, mid);
    sort(mid + 1, hi);
    merge(lo, mid, hi);
  };
  sort(0, len - 1);
  return count;
};
