var sortArray = function (nums) {
  const temp = new Array(nums.length);

  const merge = function (lo, mid, hi) {
    for (let i = lo; i <= hi; i++) {
      temp[i] = nums[i];
    }

    let i = lo,
      j = mid + 1;

    for (let p = lo; p <= hi; p++) {
      if (i === mid + 1) {
        nums[p] = temp[j++];
      } else if (j === hi + 1) {
        nums[p] = temp[i++];
      } else if (temp[j] < temp[i]) {
        nums[p] = temp[j++];
      } else {
        nums[p] = temp[i++];
      }
    }
  };

  const sort = (lo, hi) => {
    if (lo === hi) return;
    const mid = Math.floor(lo + (hi - lo) / 2);

    // [lo,mid]\u6709\u5E8F
    sort(lo, mid);
    // [mid+1,hi]\u6709\u5E8F
    sort(mid + 1, hi);
    // \u5408\u5E76\u4E24\u4E2A\u6709\u5E8F\u6570\u7EC4
    merge(lo, mid, hi);
  };

  sort(0, nums.length - 1);

  return nums;
};
