// \u5FEB\u901F\u6392\u5E8F
const quickSort = (nums, lo, hi) => {
  if (lo >= hi) return;

  // \u5BF9[lo,hi]\u6839\u636Ep\u8FDB\u884C\u5212\u5206
  // nums[lo,p-1] <= nums[p] < nums[p,hi];
  const p = partition(nums, lo, hi);

  quickSort(nums, lo, p - 1);
  quickSort(nums, p + 1, hi);
};

// \u5BF9[lo,hi]\u8FDB\u884C\u533A\u5206
const partition = (nums, lo, hi) => {
  let p = nums[lo];
  let i = lo + 1,
    j = hi;
  while (i <= j) {
    while (i < hi && nums[i] <= p) {
      i++;
      // \u7ED3\u675F\u65F6\uFF0Cnums[i] > p
    }
    while (j > lo && nums[j] > p) {
      j--;
      // \u7ED3\u675F\u65F6\uFF0Cnums[j] <= p;
    }
    // \u6B64\u65F6 nums[i] <= p < nums[j]
    if (i >= j) {
      break;
    }
    swap(nums, i, j);
  }
  swap(nums, lo, j);
  return j;
};

const swap = (nums, i, j) => {
  const temp = nums[i];
  nums[i] = nums[j];
  nums[j] = temp;
};
